/*Table structure for table `wp_posts` */

DROP TABLE IF EXISTS `wp_posts`;

CREATE TABLE `wp_posts` (
  `ID` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `post_author` bigint(20) unsigned NOT NULL DEFAULT '0',
  `post_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_date_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_content` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_title` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_excerpt` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'publish',
  `comment_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'open',
  `ping_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'open',
  `post_password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `post_name` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `to_ping` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `pinged` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_modified_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_content_filtered` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_parent` bigint(20) unsigned NOT NULL DEFAULT '0',
  `guid` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `menu_order` int(11) NOT NULL DEFAULT '0',
  `post_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'post',
  `post_mime_type` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `comment_count` bigint(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`),
  KEY `post_name` (`post_name`(191)),
  KEY `type_status_date` (`post_type`,`post_status`,`post_date`,`ID`),
  KEY `post_parent` (`post_parent`),
  KEY `post_author` (`post_author`)
) ENGINE=InnoDB AUTO_INCREMENT=100 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `wp_posts` */

insert  into `wp_posts`(`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) values (1,1,'2018-11-29 04:21:19','2018-11-29 04:21:19','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-11-29 04:21:19','2018-11-29 04:21:19','',0,'http://uuam.test/?p=1',0,'post','',1),(2,1,'2018-11-29 04:21:19','2018-11-29 04:21:19','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://uuam.test/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-11-29 04:21:19','2018-11-29 04:21:19','',0,'http://uuam.test/?page_id=2',0,'page','',0),(3,1,'2018-11-29 04:21:19','2018-11-29 04:21:19','<h2>Who we are</h2><p>Our website address is: http://uuam.test.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','draft','closed','open','','privacy-policy','','','2018-11-29 04:21:19','2018-11-29 04:21:19','',0,'http://uuam.test/?page_id=3',0,'page','',0),(4,1,'2018-11-29 04:31:28','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2018-11-29 04:31:28','0000-00-00 00:00:00','',0,'http://uuam.test/?p=4',0,'post','',0),(5,1,'2018-11-29 04:56:42','2018-11-29 04:56:42','','Contact us','','publish','closed','closed','','contact-us','','','2018-11-29 04:56:42','2018-11-29 04:56:42','',0,'http://uuam.test/?page_id=5',0,'page','',0),(6,1,'2018-11-29 04:56:42','2018-11-29 04:56:42','','Contact us','','inherit','closed','closed','','5-revision-v1','','','2018-11-29 04:56:42','2018-11-29 04:56:42','',5,'http://uuam.test/2018/11/29/5-revision-v1/',0,'revision','',0),(7,1,'2018-11-29 04:59:12','2018-11-29 04:59:12',' ','','','publish','closed','closed','','7','','','2018-12-02 16:59:10','2018-12-02 16:59:10','',0,'http://uuam.test/?p=7',6,'nav_menu_item','',0),(8,1,'2018-11-29 04:59:21','0000-00-00 00:00:00','','Work','','draft','closed','closed','','','','','2018-11-29 04:59:21','0000-00-00 00:00:00','',0,'http://uuam.test/?p=8',1,'nav_menu_item','',0),(9,1,'2018-11-29 04:59:28','0000-00-00 00:00:00','','About','','draft','closed','closed','','','','','2018-11-29 04:59:28','0000-00-00 00:00:00','',0,'http://uuam.test/?p=9',1,'nav_menu_item','',0),(10,1,'2018-11-29 04:59:35','0000-00-00 00:00:00','','Culture','','draft','closed','closed','','','','','2018-11-29 04:59:35','0000-00-00 00:00:00','',0,'http://uuam.test/?p=10',1,'nav_menu_item','',0),(11,1,'2018-11-29 04:59:43','0000-00-00 00:00:00','','Services','','draft','closed','closed','','','','','2018-11-29 04:59:43','0000-00-00 00:00:00','',0,'http://uuam.test/?p=11',1,'nav_menu_item','',0),(12,1,'2018-11-29 05:00:13','0000-00-00 00:00:00','','Testimonials','','draft','closed','closed','','','','','2018-11-29 05:00:13','0000-00-00 00:00:00','',0,'http://uuam.test/?p=12',1,'nav_menu_item','',0),(14,1,'2018-11-30 03:07:55','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','